import React, {Component} from 'react';
import {Card, Col} from "react-bootstrap";

class Product extends Component {
    constructor(props) {
        super(props);
        this.state = {
            product: []
        }
    }

    render() {
        return (
            
            <Card className="my-3 p-3 rounded">
                {this.props.product.map(item => (
                    <Col key={item._id}>
                        item.name
                    </Col>

                ))}
            </Card>
        );
    }
}

export default Product;
